import React from 'react'

const Navbtn = (props: any) => {
    return (
        <button className="px-3 py-2 mx-5 my-2 rounded-lg hover:bg-gray-200 focus:outline-none" style={props.style}onClick={props.onClick}>{props.text}</button>
    )

}

const AppBar = () => {

  return (
    <div className="relative h-16 w-max bg-red-200 flex justify-end">
      <img className="absolute left-0 ml-5 h-16" src="https://cdn.logo.com/hotlink-ok/logo-social.png"/>
      {(
        <>
          <Navbtn text="Scopri" />
          <Navbtn text="Recensioni" />
          <Navbtn text="Classifiche" />
          <Navbtn style="bg-color:red;" text="P"/>
        </>
      )}
    </div>
  )
}

export default AppBar;
